import React, { useState, useEffect } from "react";
import axios from "axios";

export default function App() {
  const [businessData, setBusinessData] = useState([]);
  const [currentPage, setCurrentPage] = useState(1);
  const [filters, setFilters] = useState({
    filterOptions: ["state", "categories", "name", "city"],
    selectedFilter: "",
    filterValue: "",
    selectedFilters: [],
  });
  const pageSize = 25;

  useEffect(() => {
    const selectedFiltersString = filters.selectedFilters
      .map((filter) => `${filter.key}=${filter.value}`)
      .join("&");
    axios
      .get(
        `http://localhost:3001/api/data?page=${currentPage}&pageSize=${pageSize}&${selectedFiltersString}`
      )
      .then((response) => {
        setBusinessData(response.data);
      })
      .catch((error) => {
        console.error("Error fetching data:", error);
      });
  }, [currentPage, pageSize, filters]);

  return (
    <div className="p-3">
      <div className="mb-3">
        <label htmlFor="filterSelect" className="form-label">
          Select Filter:
        </label>
        <select
          id="filterSelect"
          className="form-select"
          value={filters.selectedFilter}
          onChange={(e) =>
            setFilters({ ...filters, selectedFilter: e.target.value })
          }
        >
          {filters.filterOptions.map((option, index) => (
            <option key={index} value={option}>
              {option}
            </option>
          ))}
        </select>
      </div>

      <div className="mb-3">
        <label htmlFor="filterValue" className="form-label">
          Enter Filter Value:
        </label>
        <input
          type="text"
          id="filterValue"
          className="form-control"
          value={filters.filterValue}
          onChange={(e) =>
            setFilters({ ...filters, filterValue: e.target.value })
          }
        />
      </div>

      <button
        className="btn btn-primary"
        onClick={() => {
          if (filters.selectedFilter && filters.filterValue) {
            setFilters({
              ...filters,
              selectedFilters: [
                ...filters.selectedFilters,
                { key: filters.selectedFilter, value: filters.filterValue },
              ],
            });
          }
        }}
      >
        Add Filter
      </button>

      <div className="mb-3">
        <strong>Selected Filters:</strong>
        <div>
          {filters.selectedFilters.map((filter, index) => (
            <span key={index} className="badge bg-secondary me-1">
              {filter.key}: {filter.value}
            </span>
          ))}
        </div>
      </div>

      <table className="table table-striped">
        <thead>
          <tr>
            <th scope="col">business_id</th>
            <th scope="col">name</th>
            <th scope="col">address</th>
            <th scope="col">city</th>
            <th scope="col">state</th>
            <th scope="col">postal_code</th>
            <th scope="col">stars</th>
            <th scope="col">review_count</th>
            <th scope="col">is_open</th>
            <th scope="col">categories</th>
          </tr>
        </thead>
        <tbody>
          {businessData.map((business) => (
            <tr key={business.business_id}>
              <td>{business.business_id}</td>
              <td>{business.name}</td>
              <td>{business.address}</td>
              <td>{business.city}</td>
              <td>{business.state}</td>
              <td>{business.postal_code}</td>
              <td>{business.stars}</td>
              <td>{business.review_count}</td>
              <td>{business.is_open}</td>
              <td>{business.categories}</td>
            </tr>
          ))}
        </tbody>
      </table>

      <div className="d-flex justify-content-between align-items-center mb-3">
        <button
          className="btn btn-primary"
          onClick={() =>
            setCurrentPage((prevPage) => Math.max(prevPage - 1, 1))
          }
          disabled={currentPage === 1}
        >
          Previous Page
        </button>
        <span className="h5"> Page {currentPage} </span>
        <button
          className="btn btn-primary"
          onClick={() => setCurrentPage((prevPage) => prevPage + 1)}
        >
          Next Page
        </button>
      </div>
    </div>
  );
}
